// ProfilesPage.js

import React from 'react';

const ProfilesPage = () => {
  const renderProfileItems = () => {
    const profileItems = [];

    for (let i = 1; i <= 62; i++) {
      profileItems.push(
        <div key={i} className="portfolio-item">
          <a href="#">
            <img src="./default.jpeg" alt="Default Image" />
            <span>Username {i}</span>
          </a>
        </div>
      );
    }

    return profileItems;
  };

  return (
    <div>
      {/* Header */}
      <header className="header">
        <h1>PORTFOLIONAIRE</h1>
      </header>

      {/* Navigation */}
      <div className="box">
        <nav className="navbar">
          <ul>
            <li>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a href="./homepage.html">Home</a></li>
            <li><a href="#">Profiles</a></li>
            <li><a href="./AboutUs.html">Contacts</a></li>
          </ul>
          <div className="search">
            <input type="text" placeholder="Search..." />
            <input className="sub_button" type="submit" value="Search" />
          </div>
          <ul>
            <li><a href="#">Login</a></li>
            <li><a href="#">Your Portfolio</a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>
          </ul>
        </nav>
      </div>

      {/* Portfolio Grid */}
      <div className="container">
        <div className="portfolio-grid">{renderProfileItems()}</div>
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>Triple A Co.</p>
      </footer>
    </div>
  );
};

export default ProfilesPage;
